[20162] = {name = "Seal of the Crusader", additional_info = "40 Mana\nInstant\nFills the Paladin with the spirit of a crusader for 30 sec, granting 60 melee attack power.  The Paladin also attacks 40% faster, but deals less damage with each attack.  Only one Seal can be active on the Paladin at any one time.\n\n Unleashing this Seal's energy will judge an enemy for 10 sec, increasing Holy damage taken by up to 30.  Your melee strikes will refresh the spell's duration.  Only one Judgement per Paladin can be active at any one time."},
[20164] = {name = "Seal of Justice", additional_info = "13% of base mana\nInstant\nFills the Paladin with the spirit of justice for 30 sec, giving each melee attack a chance to stun for 2 sec.  Only one Seal can be active on the Paladin at any one time.\n\n Unleashing this Seal's energy will judge an enemy for 10 sec, preventing them from fleeing.  Your melee strikes will refresh the spell's duration.  Only one Judgement per Paladin can be active at any one time."},
