[399969] = {name = "Deadly Brew", additional_info = "Gain the Deadly Brew ability:\n\n\nGrants several improvements to your poisons:\n\n When you inflict any other poison on a target, you also inflict Deadly Poison.\n\n If your weapon does not have a poison applied, it has a chance to trigger Instant Poison as if Instant Poison were applied.\n\n Deadly Poison and Instant Poison now gain increased damage from your Attack Power."},
[399985] = {name = "Shadowstrike", additional_info = "20 Energy 25 yd range\nInstant\nRequires Melee Weapon\nRequires Stealth\nTeleport behind your target and strike, causing 150% weapon damage to the target.  Must be stealthed.  Awards 1 combo point."},
[400009] = {name = "Between the Eyes", additional_info = "35 Energy 20 yd range\nInstant 20 sec cooldown\nRequires Ranged Weapon\nRanged Finishing move that causes damage per combo point, increased by Attack Power, and Stuns the target:\n\n 1 point:   [53 / 100 * ( + )] to [81 / 100 * ( + )] damage, 1 sec Stun\n 2 points: [53 / 100 * ( +* 2)] to [81 / 100 * ( +* 2)] damage, 2 sec Stun\n 3 points: [53 / 100 * ( +* 3)] to [81 / 100 * ( +* 3)] damage, 3 sec Stun\n 4 points: [53 / 100 * ( +* 4)] to [81 / 100 * ( +* 4)] damage, 4 sec Stun\n 5 points: [53 / 100 * ( +* 5)] to [81 / 100 * ( +* 5)] damage, 5 sec Stun\n\n Cooldown shared with Kidney Shot."},
[400012] = {name = "Blade Dance", additional_info = "25 Energy 100 yd range\nInstant\nFinishing move that increases your Parry chance by 10%.  Lasts longer per combo point:\n\n 1 point  : 14 seconds\n 2 points: 18 seconds\n 3 points: 22 seconds\n 4 points: 26 seconds\n 5 points: 30 seconds"},
[400014] = {name = "Just a Flesh Wound", additional_info = "You take 20% reduced Physical damage while Blade Dance is active. Additionally, you have 6% reduced chance to be critically hit by melee attacks, the threat generated by all your actions is massively increased, and your Feint ability is replaced with Tease, which Taunts the target to attack you.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you."},
