[400082] = {name = "Engrave Chest - Just a Flesh Wound", additional_info = "3 sec cast\nRequires Chest, Chest\nEngrave your chest or robe with the Just a Flesh Wound rune:\n\n\nYou take 20% reduced Physical damage while Blade Dance is active. Additionally, you have 6% reduced chance to be critically hit by melee attacks, the threat generated by all your actions is massively increased, and your Feint ability is replaced with Tease, which Taunts the target to attack you.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you."},
[400094] = {name = "Engrave Gloves - Mutilate", additional_info = "3 sec cast\nRequires Gloves\nEngrave your gloves with the Mutilate rune:\n\n\nInstantly attacks with both weapons for 100% weapon damage plus an additional (100 / 100 *) with each weapon.  Damage is increased by 20% against Poisoned targets.  Awards 2 combo points.\n\n Mutilate benefits from all talents and effects that trigger from or modify Backstab unless otherwise specified."},
[400095] = {name = "Engrave Chest - Quick Draw", additional_info = "3 sec cast\nRequires Chest, Chest\nEngrave your chest or robe with the Quick Draw rune:\n\n\nDraw your ranged weapon and fire a quick shot at an enemy, causing normal ranged weapon damage and reducing the target's movement speed by 50% for 6 sec. Awards 1 combo point.\n\n Quick Draw benefits from all talents and effects that trigger from or modify Sinister Strike."},
[400099] = {name = "Engrave Pants - Blade Dance", additional_info = "3 sec cast\nRequires Pants\nEngrave your pants with the Blade Dance rune:\n\n\nFinishing move that increases your Parry chance by 10%.  Lasts longer per combo point:\n\n 1 point  : 14 seconds\n 2 points: 18 seconds\n 3 points: 22 seconds\n 4 points: 26 seconds\n 5 points: 30 seconds"},
[400102] = {name = "Engrave Pants - Envenom", additional_info = "3 sec cast\nRequires Pants\nEngrave your pants with the Envenom rune:\n\n\nFinishing move that deals instant poison damage based on your Deadly Poison doses on the target.  Following the Envenom attack you have a 75% increased frequency of applying Instant Poison for 1 sec plus an additional 1 sec per combo point. One dose is activated per combo point:\n 1 dose:  [( * 100 / 100) * 1 + Attack power * 0.09] damage\n 2 doses: [( * 100 / 100) * 2 + Attack power * 0.18] damage\n 3 doses: [( * 100 / 100) * 3 + Attack power * 0.27] damage\n 4 doses: [( * 100 / 100) * 4 + Attack power * 0.36] damage\n 5 doses: [( * 100 / 100) * 5 + Attack power * 0.45] damage"},
[400105] = {name = "Engrave Gloves - Shadowstrike", additional_info = "3 sec cast\nRequires Gloves\nEngrave your gloves with the Shadowstrike rune:\n\n\nTeleport behind your target and strike, causing 150% weapon damage to the target.  Must be stealthed.  Awards 1 combo point."},
[400573] = {name = "Arcane Blast", additional_info = "Instant 3 min cooldown\nBlasts the target with energy, dealing Arcane damage.  Each time you cast Arcane Blast, the damage and healing of all other Arcane spells is increased by 15% and mana cost of Arcane Blast is increased by 175%.  Effect stacks up to 4 times and lasts 6 sec."},
[400574] = {name = "Arcane Blast", additional_info = "7% of base mana 30 yd range\n2.5 sec cast\nBlasts the target with energy, dealing (* 453 / 100) to (* 527 / 100) Arcane damage.  Each time you cast Arcane Blast, the damage and healing of all other Arcane spells is increased by 15% and mana cost of Arcane Blast is increased by 175%.  Effect stacks up to 4 times and lasts 6 sec or until any other Arcane damage or healing spell is cast."},
