[403789] = {name = "Metamorphosis", additional_info = "Metamorphosis Shapeshift\n100% of base mana\nInstant\nTransform into a Demon, increasing Armor by 500%, reducing the chance you will be critically hit by 6%, increasing your threat by 50%, increasing mana gained from Life Tap by 100%, transforming the functionality of some of your abilities, and granting some new abilities:\n\n Searing Pain: Now instant.\n\n Shadow Bolt: Becomes Shadow Cleave, a Shadow melee attack that hits up to 3 nearby enemies, but has a 6 sec cooldown.\n\n Fear: Replaced with Menace.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\n Demon Charge\n\n\nCharge an enemy and stun it for 1 sec.  Cannot be used in combat.\n\n Demonic Howl\n\n\nForces all nearby enemies to focus attacks on you for 6 sec."},
[403816] = {name = "Metamorphosis", additional_info = "Metamorphosis Shapeshift\nTransform into a Demon, increasing Armor by 500%, reducing the chance you will be critically hit by 6%, increasing your threat by 50%, increasing mana gained from Life Tap by 100%, and transforming the functionality of some of your abilities:\n\n Searing Pain: Now instant.\n\n Shadow Bolt: Becomes Shadow Cleave, a Shadow melee attack that hits up to 500 nearby enemies.\n\n Curse of Recklessness: Now also taunts your target to attack you for until cancelled.\n\n Howl of Terror: Now also forces all nearby enemies to attack you for until cancelled, but cooldown increased to 10 minutes."},
