[415467] = {name = "Mass Regeneration", additional_info = "Gain the Mass Regeneration ability:\n\n\nHeals all of target player's party members within 30 yards of target player for (* 42 / 100 * 3) health over 3 sec and applies Temporal Beacon to each target for 15 sec.\n\n Temporal Beacon\n\nRecords the subject's space-time position. 80% of all Arcane damage done by the caster will be converted to chronomantic healing on each of the caster's current Temporal Beacon targets. This healing is reduced by 50% on self, and also reduced by 80% when damage is done by Arcane Explosion."},
[415599] = {name = "Single-Minded Fury", additional_info = "Gain the Single-Minded Fury ability:\n\n\nWhile dual-wielding, your Physical damage and movement speed are increased by 10%."},
[415604] = {name = "Everlasting Affliction", additional_info = "Gain the Everlasting Affliction ability:\n\n\nDrain Life, Drain Soul, Shadowbolt, Shadow Cleave, Searing Pain, Incinerate, and Haunt refresh the duration of your Corruption on the target back to its maximum duration."},
[415605] = {name = "Demonic Tactics", additional_info = "Gain the Demonic Tactics ability:\n\n\nIncreases the melee and spell critical strike chance of you and your pet by 10%."},
[415709] = {name = "Survival of the Fittest", additional_info = "Gain the Survival of the Fittest ability:\n\n\nReduces the chance you'll be critically hit by melee attacks by 6% and reduces all damage taken by 10%. Damage taken reduced by an additional 10% while in Bear Form or Dire Bear Form."},
[415714] = {name = "Healing Rain", additional_info = "Gain the Healing Rain ability:\n\n\nSelects the area 15 yards around target player, and heals all of target player's party members within that area for (* 15 / 100) every second."},
